// src/components/ReadList.js
import ReadBook from "./ReadBook";

export default function ReadList({ read, onDeleteRead }) {
  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
      {read.map((book) => (
        <ReadBook key={book.id} book={book} onDeleteRead={onDeleteRead} />
      ))}
    </div>
  );
}
